#include <stdio.h>
#include <stdlib.h>
//
//获取复杂随机数-无字典
unsigned int get_xrandom(void){
  unsigned int _clock = clock();	//获取CPU 时钟	-- 取4位
  unsigned int _time = time(NULL);	//获取时间		-- 取5位
  unsigned int _clock4 = _clock % 10000;
  unsigned int _time5 = _time % 100000;
  unsigned int result = _clock4*_time5/9213;
  srand(result);//设置随机数种子
  //if(rand() + result - 2056 < 0)
  //printf("%d",rand() + result - 2056);//for test
  return rand() + result - 2056;
}
//
//获取以时间为基准的随机数
unsigned int get_Trandom(void){
  unsigned int _time = time(NULL);	//获取时间
  _time = _time / 10;//去除最后一位-秒位-10秒内不失效
  _time = _time % 123456789;//求余不等于除
  return _time-9213;
}
